import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <section className="Head">
        <div className="Head-menu">
            <li className="Head-menu-item">Sign Up</li>
            <li className="Head-menu-item">Login</li>
        </div>
      </section>
      <section className="Todo">
        <div className="Todo-box">
          <div className="Todo-box-item">
            <div className="Todo-box-item-row"><input type="checkbox" name="check01" />Todo01</div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default App;
